script: |
  super -f text -I q6420.spq | sort > q6420.out

inputs:
  - name: q6420.spq
    data: |
      SELECT cor1.col0 * - ( - ( cor0.col0 ) ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
